import { Text,View } from "react-native"
import { styles } from "../assets/styles/styles"
import { useState } from "react";

export default function ProfileScreen({navigation}){
    const [messageProfile, setMessageProfile] = useState("");

    
    return (
    <View style = {styles.container}>
        <Text style={{fontFamily:'Arial',fontSize:30,marginTop:10}}>Bienvenido</Text>
        <Text style={{fontFamily:'Arial',fontSize:20,marginTop:10}}>Que desea hacer</Text>
        <Button
            style={{marginTop:10}}
            textColor="#0265FE"
            onPress={()=>{
                navigation.navigate('Rent')
            }}
        >Rentar un carro</Button>
        <Button
            style={{marginTop:10}}
            textColor="#0265FE"
            onPress={()=>{
                navigation.navigate('Rent')
            }}
        >Rentar un carro</Button>
        <Button
            style={{marginTop:10}}
            textColor="#0265FE"
            onPress={()=>{
                navigation.navigate('CarReturn')
            }}
        >Rentar un carro</Button>
        <Button
            style={{marginTop:10}}
            textColor="#0265FE"
            onPress={()=>{
                navigation.navigate('Rent')
            }}
        >Rentar un carro</Button>
    </View>
    );
}
